import React, { useState } from "react"
function App() {
  const [activeTab, setActiveTab] = useState(0);
  const handleTabClick = (index) => {
    setActiveTab(index);
  };
  const renderTabs = () => {
    const tabs = [];
    for (let i = 0; i < 5; i++) {
      tabs.push(
        <button key={i} onClick={() => handleTabClick(i)}>
          {`Tab ${i + 1}`}
        </button>
      );
    }
    return tabs;
  };
  const renderPage = () => {
    switch (activeTab) {
      case 0:
        return (
          <div>
            <h2>Page 1</h2>
            <input type="text" placeholder="Enter text" />
            <input type="text" placeholder="Enter text" />
            <button>Enter</button>
          </div>
        );
      case 1:
        return (
          <div>
            <h2>Page 2</h2>
            <input type="text" placeholder="Enter text" />
            <input type="text" placeholder="Enter text" />
            <button>Enter</button>
          </div>
        );
      case 2:
        return (
          <div>
            <h2>Page 3</h2>
            <input type="text" placeholder="Enter text" />
            <input type="text" placeholder="Enter text" />
            <button>Enter</button>
          </div>
        );
      case 3:
        return (
          <div>
            <h2>Page 4</h2>
            <input type="text" placeholder="Enter text" />
            <input type="text" placeholder="Enter text" />
            <button>Enter</button>
          </div>
        );
      case 4:
        return (
          <div>
            <h2>Page 5</h2>
            <input type="text" placeholder="Enter text" />
            <input type="text" placeholder="Enter text" />
            <button>Enter</button>
          </div>
        );
      default:
        return null;
    }
  };
  return (
    <div>
      <h1>Single Page Application</h1>
      <div>{renderTabs()}</div>
      <div>{renderPage()}</div>
    </div>
  );
}
export default App;
